let book3 = new Book(2, "title 3", "author 3", "release date 3", "short bio 3", "long bio 3", "discount 3", "price 3")
let book4 = new Book(3, "title 4", "author 4", "release date 4", "short bio 4", "long bio 4", "discount 4", "price 4")

